import { mapGetters} from "vuex";

export default {
    name: "formulario",
    computed: {
        ...mapGetters([
            "objetoArquivo"
        ])
    },
    methods: {
        formatarData(data) {
            return data.getDate() + "/" + (data.getMonth() + 1) + "/" + data.getFullYear();
        }
    }
}
